import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import Home from './Home';
import Login from './Login';
import Register from './Register';
import ForgotPassword from './ForgotPassword';
import AppLayout from './AppLayout';
import Dashboard from './Dashboard';
import User from './User';
import ProfileDetail from './ProfileDetail';
import ProfileCard from './ProfileCard';
import MessagingLanding from './MessagingLanding';
import ContactUs from './ContactUs';
import SettingsPage from './SettingsPage';

const AppRoutes = () => {
  const { isLoggedIn, logout } = useAuth();  // Fetch login status and logout function from context

  // Handle logout
  const handleLogout = () => {
    logout(); // Call logout function to clear auth status and data
    window.location.replace('/'); // Redirect to the home page and replace history entry
  };

  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Home />} />
      <Route path="/login" element={isLoggedIn ? <Navigate to="/dashboard" replace /> : <Login />} />
      <Route path="/register" element={isLoggedIn ? <Navigate to="/dashboard" replace /> : <Register />} />
      <Route path="/forgot-password" element={<ForgotPassword />} />

      {/* Protected Routes */}
      <Route
        path="/dashboard"
        element={isLoggedIn ? (
          <AppLayout>
            <Dashboard />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/user"
        element={isLoggedIn ? (
          <AppLayout>
            <User />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/profile-detail"
        element={isLoggedIn ? (
          <AppLayout>
            <ProfileDetail />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/profile-card"
        element={isLoggedIn ? (
          <AppLayout>
            <ProfileCard />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/messaginglanding"
        element={isLoggedIn ? (
          <AppLayout>
            <MessagingLanding />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/contact"
        element={isLoggedIn ? (
          <AppLayout>
            <ContactUs />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
      <Route
        path="/settings"
        element={isLoggedIn ? (
          <AppLayout>
            <SettingsPage />
          </AppLayout>
        ) : (
          <Navigate to="/login" replace />
        )}
      />
    </Routes>
  );
};

export default AppRoutes;
